import React from "react";
import "./style.css";

const Searchbar = () => {
  return (
    <section className="search-bar">
      <input
        className="search-box"
        type="text"
        placeholder="Search for a movie"
      />
      <div class="button">
        <span>HOVER ME</span>
      </div>
    </section>
  );
};

export default Searchbar;
